44	long_description	The Transitional Shelter program provides a stable and safe environment and case management for 10 chronically homeless men and graduates from our addiction recovery program.  For those needing additional job readiness skills and work placement assistance we offer entrance into our Homeless Job Empowerment Program (HJEP). HJEP is a soft skills/ job readiness training program. The HJEP program assists these individuals in achieving economic self-sufficiency and housing by addressing the barriers most homeless people face in obtaining employment and housing. We offer a bed with shower and laundry facilities and mail, phone, and internet access, nutritious meals, job preparation, search and placement, resume assistance, instruction in interview skills, computer skills classes, money management and financial education classes, legal services, and case management for each client.(changed)	22
