1045	long_description	Huckleberry House offers continuous 24-hour crisis intervention and resolution services and emergency shelter to high-need youth between the ages of 11 and 17. Located on Page Street (at Lyon) in San Francisco, Huckleberry House is the oldest program for runaway and homeless youth in the country. Program goals are to alleviate problems of runaway and homeless youth, reunite youth with their families, empower youth to identify healthy lifestyle alternatives and develop positive decision-making.\n\nThrough a continuum of care service model, the program creates a network of support for positive, healthy adolescent development. Most of the clients are from the San Francisco Bay Area, which allows us to deliver extended family preservation counseling. All Huckleberry youth receive primary medical care and peer-based prevention education through Huckleberry’s Cole Street Clinic.	513
