1184	long_description	San Francisco Public Works operates the Pit Stop program, which provides clean and safe public toilets, sinks, used needle receptacles and dog waste stations in San Francisco's most impacted neighborhoods.\n\nThe program utilizes both portable toilets, which are trucked to and from the sites daily after overnight servicing at a remote location, and the semi-permanent JCDecaux self-cleaning toilets.\n\nAll the Pit Stop facilities are staffed by paid attendants who help ensure that the toilets are well maintained and used for their intended purpose. The program, which began in July 2014, now operates at 17 locations, providing an alternative to using our streets and sidewalks as a toilet. Not only do the people who need a bathroom benefit, but so do the neighborhoods.	578
