1955	long_description	We can provide referrals, shelter, help replace a lost birth certificate, assist you with enrolling in benefits, get you help, and partner with you in goal-setting or understanding your needed next steps.\nhttps://www.glide.org/beyondcrisis\n\n- Shelter Info:\nGLIDE is the only site in the Tenderloin where people can reserve a bed in San Francisco's shelter system. Reservations can be made in the Walk-In Center through the CHANGES system for 1-day and weekend beds on a first-come, first-served basis. If you are seeking a 90-day bed reservation we can also assist with enrolling you on the 311 wait list.\n\n- Rental Assistance Info\nGLIDE, in collaboration with the Seasons of Sharing Fund and Catholic Charities, provides access to financial help for individuals and families with back rent, rental and security deposits, and other critical needs. We do rental assistance screening and intakes on the First and Third Friday of every month.\n\n- Basic Needs Services\nGLIDE provides discounted vouchers for DMV Identification Cards, housing information, application assistance, referrals, benefit enrollments and hygiene kits.\n\n- Case Management and Family Resource Center\nGlide case managers work with individuals and families to offer support on meeting short-term and long-term goals, build on strengths to move beyond crisis situations and work towards greater stability.\nGeneral Case Management: 415.674.6027\nFamily Case Management Services: 415.674.6190	891
1958	application_process	The first time you reserve a bed you will enroll in the CHANGES computer system giving your name, date and place of birth, gender, ethnicity, and a Social Security Number ( Social Security Number is optional). Your photograph and finger print will be taken to establish your "unique identity".   (This is not a finger print or photo of your finger print.  The digital finger identification cannot be shared outside of CHANGES nor can it produce an image of your finger print.  It is used to bring up your profile when you make a reservation or check into the shelter.) This is done to ensure that only you can claim the shelter space you reserve.   \n\nTo enroll in the CHANGES computer system, go to the Glide Walk-in Center in person.\n\nReservations can be made in the Walk-In Center through the CHANGES system for 1-day and 90-day beds on a first-come, first-served basis. \n\n Reservations for one night and weekend stays are taken in the afternoons starting at 3:00pm at the Glide Walk-in Center until all available spaces are filled. All reservations must be requested in person.\n \nLong-term (90 day) reservations are made through the 311 Waitlist process. To join the Waitlist, interested individuals who are registered in CHANGES can call 311 at any time to be added to the Waitlist. People can also go to a Reservation Station to get added to the Waitlist.	891
