2615	long_description	Emergency youth shelter - Shelter for Youths 18-24.  Length of stay varies; maximum 4 months. 3 meals daily for long-term shelter guests. Job readiness training, remedial education, GED & college-entry prep available. Call or show up any time to get on waiting list for a bed.  Up to 21 nights per year of emergency shelter; show up at 9:40pm each night for emergency bed lottery. English, Spanish.\n\nWhile our emergency shelters offer a bed for the night, Larkin Street also has several housing programs if you are looking for longer-term support (two years or more).\n\nBecause every young person has different needs, we offer a continuum of housing options – from dorm-style living with 24-hour on-site staff, to independent apartments in the community. All of our programs have case managers to help you plan for the future, education and employment support, health and wellness services, and fun community activities.	1122
