3787	long_description	Report Suspected Child Abuse or Neglect\nIf you suspect that a child in San Francisco is being abused or neglected, call the Family and Children's Services (FCS) Hotline at (800) 856-5553 to make a confidential report anytime, 24 hours per day. Be prepared to provide the child's name, address, approximate age and situation. You do not have to leave your name.\n\nWhat Happens if Someone Makes a Hotline Report of Suspected Abuse About Your Child?\nAnyone can call the child abuse hotline to report suspected abuse or neglect.  Mandated reporters, however, are legally required to report known or suspected child abuse. These include workers in county welfare, doctors, nurses, clergy, school teachers and counselors, employees of day care, etc.	1611
