3893	long_description	For Veterans only.\nProvides general medical, surgical and psychiatric services for veterans. Inpatient and outpatient services include arthritic rheumatology, cardiology, dermatology, endocrinology, eye, ear/nose/throat, gastrointestinal, hematology, hemodialysis, infectious disease, medical research, neurology, neurosurgery , nuclear medicine, heart surgery, ophthalmology, orthopedics, plastic surgery, podiatry, respiratory care, social work services and substance abuse. Provides limited dental care, eye glasses and other prosthetics, based on eligibility. Maintains a 120-bed nursing home providing skilled nursing and hospice care.\n\nThe Women Veterans Comprehensive Health Center provides medical and psychiatric care for women of all ages. Evaluation and treatment is available for acute and chronic general medical problems, sexual trauma, preventive care, health screenings and testing and comprehensive gynecological services.\n\nCall 415-750-2174, M-F: 8am-4:30pm for information.\n\nVeterans need a VA card for all services. Veterans without a card can take discharge papers to Medical Administration Services in Bldg. 200. Fees for most services vary according to veteran status and income, private insurance accepted. No fees for alcohol and drug treatment programs. Spanish.\n	1662
