3957	long_description	Lyon-Martin Health Services provides excellent health care, mental health and HIV services to all women, lesbians and transgender people in a safe and compassionate environment, with sensitivity to sexual orientation and gender identity. \n\nAll services are offered regardless of your ability to pay.\n\nLyon-Martin is a safe, warm, welcoming environment, a medical “home” for our patients.  We are non-judgmental and down to earth.  We recognize each person as unique and value their distinctive point of view.  We believe good health means caring for both the body and the mind.  We listen to our patients.  Our promise is to meet people where they are.  Our hope is to help them positively change their life experience.	1696
3958	long_description	We are non-judgmental and down to earth.  We recognize each person as unique and value their distinctive point of view.  We believe good health means caring for both the body and the mind.  We listen to our patients.  Our promise is to meet people where they are.  Our hope is to help them positively change their life experience.\n\nServices include:\n\n- Care for common episodic medical problems (i.e. colds, urinary tract infections)\n- Routine physicals and employment examinations\n- Breast/chest health screening and referrals\n- HIV primary care\n- Gynecological care and family planning\n- Hormone therapy for gender transition\n- HIV and STD testing, diagnosis and treatment\n- Chronic disease management (i.e., diabetes, asthma, depression, high blood pressure, chronic pain)\n- Vaccinations	1692
