4201	long_description	Pregnancy Test, STD Testing, STD Treatment, HIV Testing, Family Planning. $10 fee, no one turned away for lack of funds.\n\nSTD services at City Clinic are offered on a drop-in basis. Specially trained healthcare providers are available for evaluation, testing and treatment for common sexually transmitted diseases such as chlamydia, gonorrhea, genital warts, herpes, non-gonoccocal urethritis (NGU), syphilis, and vaginal infections (trichomoniasis, yeast, and bacterial vaginosis). There are also testing and treatment services available for many lesser known STDs like chancroid, crabs, lymphogranuloma venereum, molluscum contagiosum, mucopurulent cervicitis, pelvic inflammatory disease (PID), and scabies, among others.\n\nIn addition to clinical exams and evaluation, the Clinic offers on-site lab testing, on-site dispension of medications and STD patient education and partner notification and treatment services.\n\nHepatitis A and Hepatitis B immunization series are made available to some people after they've had an STD evaluation at the Clinic. Both vaccination series are offered to men who have sex with men and injection drug users. Hepatitis B shots are also offered to any sexually active person under age 30. People who don't meet these criteria may be offered immunizations on a case-by-case basis after speaking to a clinician. The Hepatitis A series is two shots at 0 and 4-6 months. The Hepatitis B series is 3 shots at 0, 1, and 6 months. You must complete an entire series for full protection against that particular strain of the virus.	1798
