219	2017-03-03 01:01:35.161077	2017-06-17 22:01:27.39043	Technology Access	Internet Access:\n\nFree Wi-Fi is available at the Marina Branch during all opening hours.\n\nInternet can also be accessed via using one of the public computers at the library. There is a 2 hour per day per location limit on using the public computers.\n\nComputer Access:\n\nFor instructions on how to book a computer at the library refer to application process below.\n	You must have a SF library card for computer use. \n\nFor application process on how to get a library card, refer to section <How do you apply for this service>\n	SF Library Card\n\nValid Photo ID (if you don't have SF library card and need to apply for one)\n	0	Library Card Application\n\n1) Apply online (https://sflib1.sfpl.org/selfreg)\n\n2) Or fill out and print the paper application \n\n3)  then present a valid ID in-person at any SFPL location to receive a library card. \n\n4) The Library does not issue library cards online; you must visit in-person. \n\n5) You cannot apply for a library card without valid photo ID. But SF Public Library also offers Welcome, Digital Access and Visitor Cards to those without a valid photo ID, this will allow the visitor temporary access to services offered.\n\nHow to access free Wi-Fi at SFPL\n\nFinding Library Hot Spots\n1) To find the Library's hot spots, click on your wireless icon in the taskbar. If no icon is present:\n\n2) Click Start, Settings, then Network Connections\nRight click Wireless Network Connection and then click View Available Wireless Networks (a list of wireless access points appears in the Available Networks box)\n\n3) Click the #SFWiFi SSID wireless network connection\n4) Click Connect\n\nFor more guidance on connecting using different operating systems goto this webpage - http://sfpl.libanswers.com/faq/88545\n\nPublic Computer Access\n\n1. Walk-up booking \n\n10 minutes will be deducted from 120 minutes of the user's daily computer allotment per location.\n\n2. Reserve online \n\nUsing the library's Wi-Fi, access this webpage:\nhttps://sfpl.org/index.php?pg=2000003001\n\na) Click the Reserve a Computer button above.\nSelect the location at which you would like to reserve a computer from the dropdown menu.\n\nb) Type in your Library card number and PIN/password.\n\nc) From the next dropdown menus, select either the Area you would like to use a PC in (“Adult”, “Children”, “Hoopla Station”, etc.) or the specific computer you would like to use.\n\nd) Select the date and time you’d prefer for your reservation to occur.\n\ne) Click Submit.\n\nf) Write down the computer station number, and the reservation date and time.\n\ng) NOTE: If a reservation is not available at the time you requested, the system will show you the next available reservation highlighted in red.\n\nh) To accept a reservation, click Accept. To cancel a reservation, click Cancel this Reservation.Click the Reserve a Computer button above.\n	193	\N	marmgr@sfpl.org	1
356	2017-06-17 22:44:04.605085	2017-06-17 22:44:04.605085	Substance Abuse Counseling and Case Management Services (LGBTQ)	The AIDS and Substance Abuse Program (ASAP) provides a lesbian, gay, bisexual, transgender, and queer (LGBTQ) supportive environment for LGBTQ people—with or without HIV—seeking to address the impact of substance use on their ability to create meaningful and constructive lives. ASAP offers individual substance abuse counseling, limited case management, and group support services. ASAP applies a harm reduction model—which it began using in 1985—toward ensuring the health and wellness of our clients.	AHP provides mental health crisis or psychiatric assessment and medication management to people who are lesbian, gay, bisexual, transgender, or queer (LGBTQ) identified or wish to receive services in an LGBTQ-affirmative clinic.	\N	0	For more information about ASAP services, please call 415-476-3902 and ask to speak with the triage clinician on duty.	129	\N	\N	0
357	2017-06-17 22:44:04.632662	2017-06-17 22:44:04.632662	Support and Therapy Groups	AHP groups vary in terms of the number of weeks they last, who facilitates them, and what lesbian, gay, bisexual, transgender, and queer (LGBTQ) or HIV-related topics they address:\n\nComplete List of AHP Groups:\n\nGroups for the LGBTQ Community\nDROP-IN GROUPS\nTIME-LIMITED GROUPS\nAging Group for Gay and Bisexual Men\nSex and Sobriety\nStrong and Proud\n\nONGOING GROUPS\nGay and Bisexual Men’s Group\nQueer Women’s Disability and Chronic Illness Group\nTransgender Support Group\n\nTopics: living with HIV; depression and anxiety; aging; substance abuse; trauma; returning to work after being on disability; and transgender support	Some groups are limited to people living with HIV or gay and bisexual men at risk for acquiring HIV. Other groups are open to individuals regardless of HIV status but specifically for gay or bisexual men, lesbian or bisexual women, or transgender-identified people.	\N	\N	All groups, except drop-in groups, require a formal intake appointment, during which a clinician will help identify the best service for you based on your specific needs and concerns. For more information, please call 415-476-3902 and ask to speak with the triage clinician on duty.	129	\N	\N	0
