447	2017-07-16 22:00:09.345275	2017-07-16 22:00:09.345275	Post-Exposure Prevention (PEP)	PEP is a 28-day course of treatment believed to be effective in preventing an infection with HIV. At City Clinic, we offer expert evaluation within 72 hours of a possible exposure to HIV. It is important to come in as soon as possible after you think you have been exposed. You can call (415) 487-5538 to discuss your situation with a counselor before coming to the clinic for services. Once you arrive at the clinic, you will meet with a clinician who will evaluate whether PEP is appropriate for you and if so, will discuss which medications are used. You will also receive counseling from a trained PEP counselor, get tested for HIV and STDs, and receive a schedule for follow-up appointments at 1 month and 3 months. A full course of PEP is 28 days of medication.\n\nPlease note that City Clinic cannot provide a full course (28 days) of PEP medications for any patient.  Because it is important not to delay starting the medications, if a City Clinic clinician recommends that you take PEP you will be given 2 days worth of medication in clinic to start right away with a prescription for the remaining doses. PEP counseling staff will then work with you to discuss best options for obtaining the rest of the medications. San Francisco residents who meet income eligibility requirements have some options for obtaining these medications at low cost. For those with health insurance, many plans will cover the cost of the medications. Call 415-487-5538 to discuss your eligibility.	\N	\N	\N	Walk in appointments are available.	63	\N	\N	0
