449	2017-07-16 22:00:09.375206	2017-07-16 22:00:09.375206	Women's Health Services	Confidential sexual health services for women age 12 and older are available at City Clinic both on a drop-in and appointment basis. \n\nThe HPV vaccine is available free to women without health insurance.\nSome birth control (condoms, Depo Provera injections) are available on-site. If you choose oral contraceptives (the Pill), the contraceptive patch, or the vaginal ring (NuvaRing), you will leave your appointment with a prescription that you can get filled at a local pharmacy. To learn more about what contraceptive method is best for you, view their website.\n\nEmergency contraception, also known as the "morning after pill," can be provided by Clinic staff within 120 hours of unprotected intercourse. If you are in this situation, come to the Clinic as soon as possible to talk to a clinician and learn about your choices.	Women aged 12 and older.	\N	\N	We offer several options for appointments at Women's clinic:\n\nE-mail us at SFCCwomensclinic@sfdph.org to be contacted about scheduling an appointment. E-mails are checked routinely and you will receive a response within two business days.\nCall 415-487-5552 and leave a message with your name and contact information.\nSame day appointments are sometimes available but are not guaranteed: Call 487-5500 the morning you would like to be seen or drop in to inquire about appointment availability.\n\nFor non-urgent women’s health issues (e.g. Pap smears, birth control pills, STD checks without symptoms), we encourage you to come to Thursday morning women’s clinic as you will be seen much more quickly than during drop-in hours.	63	\N	SFCCwomensclinic@sfdph.org	0
